import React from 'react';
import styled from 'styled-components';
import Cart from './Cart';

const TopHead = () => {
  return (
    <Container>
      <Logo>
        <img src="../static/logo.png" alt="logo" width="50px" height="50px" />
      </Logo>
      <Form>
        <Input placeholder="Bạn tìm gì.." />
      </Form>
      <DonHangDiv>
        <A href="/#">Đơn Hàng Của Bạn</A>
      </DonHangDiv>
      <Cart />
    </Container>
  );
};

const Container = styled.div`
  margin: 0 0 0 250px;
  height: 50px;
`;

const Logo = styled.div`
  float: left;
`;

const Form = styled.form`
  float: left;
  margin-top: 5px;
  margin-left: 15px;
`;

const Input = styled.input`
  width: 600px;
  height: 40px;
  border-radius: 5px;
  font-size: 22px;
  border: 0px solid;
  padding-left: 15px;
  padding-bottom: 5px;
`;

const DonHangDiv = styled.div`
  color: #fff;
  height: 50px;
  float: left;
`;

const A = styled.a`
  :active,
  :visited,
  :hover,
  :link {
    color: #fff;
    text-decoration: none;
  }
  display: block;
  text-align: center;
  width: 104px;
  font-size: 14px;
  padding: 4px 10px 10px 4px;
`;

export default TopHead;
